import React from "react";
function Nav() {
  return (
    <div className="header shadow cshadow coreshadow">
      <div className="container">
        <div className="logo">
          <div className="nav">
            <img alt="Home Icon" className="home-icon" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Nav;
